import React from 'react';
import Header from '../Header';
function Feminino({ calcados }){
    return(
        // console.log(modelo.filter((item)=> item.modelo === 'Feminino'))
        <div>
            <ul>
                {calcados.filter((item)=>item.modelo === 'Feminino')
                    .map((item,index)=>(
                        <li key={index}>
                            <h1>{item.nome}</h1>
                            <img src={item.imagemUrl}/>
                        </li>
                    ))}
            </ul>

        </div>
    );
};

export default Feminino;
